"use strict";$(function(){$("[data-send=json]").click(function(){var t=$(this),i=t.data("name"),r=t.data("value"),n=$("#flash"),u=$.ajax({url:"/data/"+i,cache:!1,data:{id:r}}).done(function(t){console.log("success");var i=JSON.parse(t);n.addClass("alert-success");n.html(i.html);n.animate({height:"6vh",speed:500});setTimeout(function(){n.fadeOut();setTimeout(function(){n.height(0)},1e3)},3e3)}).fail(function(){console.log("error")}).always(function(){console.log("complete")})})});